     "name": "question5",
     "maxWidth": "600px",
     "html": "<br /><h3 style=\"text-align:center\"> AUTHORIZATION FORM</h3><br /><br />\n\n<h3 style=\"text-align:center\"> <b>PERMISSION<sup>1</sup> FOR USE OR DISCLOSURE OF PROTECTED HEALTH INFORMATION FOR RESEARCH PURPOSES</b></h3><br />\n\n<h4 style=\"text-align:left\">\nPRINCIPAL INVESTIGATOR (Individual in charge of the research team at CHLA): Dr. Pat Levitt, Dr. Beth Smith and Dr. Jessica Wisnowski</h4><br />\n\n<h4 style=\"text-align:left\">\nTITLE OF STUDY: The HEALthy Brain and Child Development (HBCD) Pilot Study</h4><br />\n\n<h4 style=\"text-align:left\">\nPURPOSE: The purpose of this pilot study is to inform a nation-wide research project that is intended to learn how children grow and change (develop) early in life.  We will study children’s thinking, behavior, social interactions, emotions, and brains from birth through 10 years old.</h4>\n\n\n"
