     "type": "html",
     "name": "question8",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b><u>BACKGROUND and DEFINITIONS</u></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\"><b>HIPAA</b> stands for the <b>Health Insurance Portability and Accountability Act</b>. HIPAA contains federal regulations that govern the privacy and confidentiality of medical information maintained by healthcare providers. Participants in research studies are protected by HIPAA regulations.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Information used in research studies may include data that identifies you.   When you decide to take part in a research study, you must give permission for your protected health information to be released from the research team at Children’s Hospital Los Angeles and your doctors to the outside researchers involved in conducting the research study.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"><b>Protected health information</b> is personal information that can identify you or that can be linked to you. Examples of protected health information include personal information such as your date of birth or where you live and information about your medical condition. Only you or your legal representative can give permission for your protected health information to be released.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">By agreeing to sign this authorization form, you are allowing researchers at Children’s Hospital Los Angeles to collect your protected health information and share it with others involved in doing this research study as detailed below, consistent with California and Federal laws concerning the privacy of this information.</p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page3",
   "elements": [
    {
     "type": "html",
     "name": "question12",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b><u>RESEARCH STUDY INFORMATION</u></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Your protected health information will be used for the following research study:</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The protected health information that is needed for this research study includes:</p>\n<ul style=\"text-align:left;color:black;font-size:16px\"><li><i>Personal demographic information;</i></li>\n<li><i>History and diagnosis of your medical condition;</i></li>\n<li><i>Specific information about the treatments you will receive or have received, including treatment(s) you may have had in the past; </i></li>\n<li><i>Long-term information about your general health status and the status of your medical condition.</i></li></ul><br />\n\n<p style=\"text-align:left;color:black;font-size:16px\"><i>Under no circumstances are you required to authorize the disclosure of psychotherapy notes.  </i></p>\n\n\n<hr style=\"width:50%;border:1px solid black\" />\n\n<p style=\"text-align:left;color:black;font-size:16px\">California law prohibits the disclosure of any protected health information not listed in this authorization unless another authorization form is obtained from you or unless such disclosure is specifically required or permitted by law. </p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">In addition, your medical records may need to be reviewed and the researchers may need to discuss your health information with your healthcare providers. This research also may create new information about you as a result of research procedures, tests, questionnaires, interviews, and visits.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The research team at Children’s Hospital Los Angeles <i>does not receive</i> payment for your participation in this research study and subsequent use of your protected health information. </p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page4",
   "elements": [
    {
     "type": "html",
     "name": "question69",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b><u>DISCLOSURE OF PROTECTED HEALTH INFORMATION</u></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You give permission for the following persons, groups or organizations to use or disclose (release) your protected health information for the research study described in this authorization form.</p>\n\n<ol style=\"text-align:left;color:black;font-size:16px\">\n<li>Dr. Pat Levitt, Dr. Beth Smith and Dr. Jessica Wisnowski and his/her research staff</li>\n<li>Physicians and other healthcare providers</li>\n<li>The CHLA Institutional Review Board for oversight and compliance purposes</li>\n</ol>\n\n<h4 style=\"text-align:left\"><b><u>RECEIPT OF PROTECTED HEALTH INFORMATION</u></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You give permission for the following persons, groups or organizations to receive your protected health information for the research study described in this authorization form.</p>\n\n<ol style=\"text-align:left;color:black;font-size:16px\">\n<li>The following institutions/investigators that are participating in this research: Dr. Pat Levitt, Dr. Beth Smith and Dr. Jessica Wisnowski at Children’s Hospital Los Angeles</li>\n<li>Federal and State agencies that have authority over the research when required by law.</li>\n<li>Hospital, its representatives, or other accrediting agencies.</li>\n<li>Your health insurer or payer, if necessary, to secure their payment for any covered treatment not paid for by the research. </li>\n</ol>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page5",
   "elements": [
    {
     "type": "html",
     "name": "question10",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b><u>CONFIDENTIALITY and PRIVACY</u></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Efforts will be made to ensure that your protected health information will not be shared with other persons, groups or organizations outside of the research study.  Those persons who receive your health information may not be required by privacy laws to protect it and may share your information with others without your permission, if permitted by laws governing them.  The research team cannot guarantee absolute confidentiality and privacy.</p>\n\n<h4 style=\"text-align:left\"><b><u>EXPIRATION</u></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">This authorization will expire on January 15, 2113. This is because information that is collected for research purposes continues to be analyzed for many years and it is not possible to determine when it will be complete.</p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page6",
   "elements": [
    {
     "type": "html",
     "name": "question9",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b><u>YOUR RIGHTS</u></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You may decide not to sign this authorization form. If you do not sign this authorization form, you will not be able to take part in this research study.  Your regular healthcare including treatment, payment or enrollment in any health plans or your eligibility for benefits will not be affected if you decide not to sign.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You may revoke your permission at any time for Children’s Hospital Los Angeles to use or share your protected health information collected for this research study.  However, even if you revoke this authorization, the hospital and the research team may still use information about you that was collected as part of the research project (i.e., side-effects related to the research) between the date you signed the current form, and the date you revoked the authorization.  This is to protect the quality, integrity and reliability of the research results. Once you revoke your authorization, no further protected health information will be disclosed.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You must revoke your authorization in writing. You may submit a written request to revoke your authorization or you may request a form for this purpose from the CHLA Human Subjects Protection Program, (323) 361-2265. This document must be signed by you or on your behalf and delivered to the following address: Beth Smith, PT, DPT, PhD, Children’s Hospital Los Angeles, 4650 Sunset Boulevard, Mail Stop 135, Los Angeles, California 90027.  </p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Your cancellation will be effective upon receipt, but will not be effective to the extent that the Children’s Hospital Los Angeles research team or others have acted in reliance upon this Authorization.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You will receive a copy of this Authorization Form.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You have the right to review and/or copy your medical records containing your protected health information kept by Children’s Hospital Los Angeles.  </p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You will be allowed to review your medical records collected for research at any time, including while the study is ongoing.</p>"
    }
